    <Col span={6} >

    <Card title="Confirmed Cases" bordered={false} hoverable
    style={{ width: "100%" }}
    >

        <p className="text">Confirmed cases of Covid-19: </p>

        <h2 class="gradient-multiline"><span><CountUp

    start={0}
