        <p className="text">Total Recovered from Covid-19: </p>

        <h2 class="gradient-multiline"><span><CountUp
    start={0}
    end={1000000}
    separator=","
    duration={3}
    delay={0.5}
    /></span></h2>

    <p> Last Updated: </p>
    </Card>
    </Col>

    <Col span={6} >

    <Card title="Total Deaths" bordered={false} hoverable
