        <p className="text"> Total Deaths due to Covid-19: </p>
        <h2 class="gradient-multiline"><span><CountUp
    start={0}
    end={1000000}
    duration={3}
    separator=","
    delay={0.5}
    /></span></h2>

    <p>Last Updated: </p>
    </Card>
    </Col>

    </Row> )
}

export default Country;
